descripcion_original_en:
@visitcancun is a true gem! 

With lush forests, tropical jungles and pristine beaches there was also a perfect setting waiting to be captured in the backdrop of our 2024 SI Swimsuit photoshoot with @loriharvey @kateupton @brooksnader @gayleking @justtnic @noordinarynoire @huntermcgrady @lcchan @elliethumann and @jenamsims 

To see more of what we’re talking about head to the link in our bio.

descripcion_traducida_es:
@VisitCancun es una verdadera joya! 

Con exuberantes bosques, selvas tropicales y playas vírgenes también había un escenario perfecto esperando ser capturado en el telón de fondo de nuestra sesión de fotos de trajes de baño 2024 SI con @LoriHarvey @Kateupton @Brooksnader @gayleking 

Para ver más de lo que estamos hablando, diríjase al enlace en nuestra biografía.

