descripcion_original_en:
@GoQuintanaRoo witnessed the election of @justtnic as @SI_Swimsuit Rookie of the year at a cocktail party at the @KempinskiCancun! 

In addition to her modeling career, Nicole Williams is an entrepreneur and mom who did a stunning photo shoot for this year's #SISwimSwit edition while seven months pregnant. 

📸 Along with other models, Nicole will participate in this year's special 60th-anniversary edition of #SISwimsuit, surrounded by the natural beauty of @VisitCancun, @islamujeres.mx, and @gopuertomorelos, destinations chosen by the iconic @sportsillustrated magazine. 

👏 Congratulations @justtnic! This recognition is a testament to your dedication, passion, and success in the many facets of your life.

@cptq.mx #GoQuintanaRoo #VisitQuintanaRoo #MexicanCaribbean #MexicanCaribbean #VisitCancun #Cancun #VisitIslaMujeres #IslaMujeres #VisitPuertoMorelos #PuertoMorelos

descripcion_traducida_es:
@Goquintanaroo fue testigo de la elección de @justtnic como @Si_SwimSuit Novato del año en un cóctel en el @kempinskicancun. 

Además de su carrera de modelaje, Nicole Williams es una empresaria y madre que hizo una impresionante sesión de fotos para la edición #SISWIMSWIT de este año mientras estaba embarazada de siete meses. 

📸 Junto con otros modelos, Nicole participará en la edición especial del 60 aniversario de este año de #SisWimSuit, rodeada por la belleza natural de @visitcancun, @islamujeres.mx y @goPuertomorelos, destinos elegidos por la icónica @Sportsilustrated Magazine. 

👏 ¡Felicitaciones @justtnic! Este reconocimiento es un testimonio de su dedicación, pasión y éxito en las muchas facetas de su vida.

@cptq.mx #goquintanaroo #visitquintanaroo #mexicancaribbean #mexicancaribbean #visitcancun #cancun #visitislamujeres #islamujeres #visitpuertomorelos #puertomorelos

